import React, { Fragment } from 'react';
import Header from '../header/header';
import LoginForm from '../login-form/login-form';
import './app.css';
import { Provider } from 'react-redux'

const App = () => {
  return (
    <Fragment>
      <Provider>

      <Header />
      <LoginForm />
      </Provider>
    </Fragment>
  )
}

export default App;
